import React from 'react';
import ReactDOM from 'react-dom';
import * as serviceWorker from '../serviceWorker';
import withConnect from '../components/withConnect';
import AudioAnnotationApp from '../components/audio-temp';
import { samplePayload } from '../components/audio-temp/payload';
import { AnnotationType } from '../types';

const AudioAnnotationComp: React.FC = withConnect({ type: AnnotationType.AUDIO_TEMP, methods: { onSubmit: 'exportResult' }, samplePayload })(AudioAnnotationApp);

ReactDOM.render(
  <AudioAnnotationComp />,
  document.getElementById('root'),
);

serviceWorker.unregister();
